    poz = 0
    new_line = []
    print(q)
    for i, gate in enumerate(gateline):
        if gate[0] == 'MS' or i + 1 == len(gateline):
            # include the last gate if at the end
            end = i if gate[0] == 'MS' else i + 1
            clump = gateline[poz:end]

            # Only process if it's RX/RY-only
            if all(g[0] in ('RX', 'RY') for g in clump):
                result = nadomestnaVrata(clump)
                # Update qubit index to q
                new_line.extend([(g[0], g[1], q) for g in result['gates']])
            else:
                new_line.extend(clump)

            # Append MS gate if we stopped at one
            if gate[0] == 'MS':
                new_line.append(gate)

            poz = i + 1

        for i, g in enumerate(new_line):
            if g[0][0] == 'R' and g[1] == 0.0:
                new_line.pop(i)
    gates_seperated[q] = new_line


